Por esse motivo, tinha cogitado fazer essa tatuagem que está ai na foto há uns 5 anos atrás, somente pela minha linha sanguínea.

Ainda bem que não fiz.

Hoje, fiz essa tatuagem com muitos mais significados: 
- Me lembra meus avós, que já foram..

- Me lembra da minha família que mora em Portugal, tanto a que se mudou, quanto a que sempre viveu lá..

- Me lembra todos que ajudaram e apoiaram o meu sonho de ir morar lá durante 6 meses..

- Me lembra meu intercâmbio, todos os momentos maravilhosos que lá vivi e principalmente os amigos que deixei lá na terrinha, os que voltaram ao Brasil comigo e os que ficaram espalhados pela Europa..

- Me faz lembrar meu objetivo e sonho de voltar pra Portugal e morar lá..

Queria agradecer muito a @_vitoria.jtattoo por eternizar essas memórias e sonhos na minha pele. Pode ter certeza que foi a primeira de algumas tattoos que vão vir por ai 😍

